import React from 'react';
import CircularProgress from './CircularProgress';

const WorkspaceHeader = () => {
  return (
    <div className="p-4 border-b border-gray-100">
      <div className="flex items-center justify-between mb-4">
        <div className="flex items-center gap-2">
          <div className="w-4 h-4 bg-ella-blue rounded-sm"></div>
          <span className="font-semibold text-ella-text">Workspace 1</span>
        </div>
        <button className="w-5 h-5 text-gray-600 hover:text-gray-800">
          <svg fill="currentColor" viewBox="0 0 24 24">
            <path d="M12 8c1.1 0 2-.9 2-2s-.9-2-2-2-2 .9-2 2 .9 2 2 2zm0 2c-1.1 0-2 .9-2 2s.9 2 2 2 2-.9 2-2-.9-2-2-2zm0 6c-1.1 0-2 .9-2 2s.9 2 2 2 2-.9 2-2-.9-2-2-2z"/>
          </svg>
        </button>
      </div>

      {/* Ellaments Tab */}
      <div className="border-t border-gray-100 pt-4">
        <div className="relative bg-white border border-gray-200 rounded-md w-full h-14 flex items-center overflow-hidden px-4 py-4 mb-4">
          {/* Background Layer */}
          <div className="absolute inset-0 w-full h-6"></div>

          {/* Content Layer */}
          <div className="absolute left-4 top-4 w-68 overflow-hidden flex flex-row justify-between">
            <div className="flex items-center gap-2">
              <div className="w-5 h-5 text-gray-600 mt-0.5">
                <svg fill="currentColor" viewBox="0 0 24 24">
                  <path d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z"/>
                </svg>
              </div>
              <div className="text-ella-blue leading-6 w-40 flex items-center text-ellipsis min-h-6">
                Brand Bot Ellaments
              </div>
            </div>
            <div className="w-7 text-gray-700 text-xs text-center flex justify-center items-center mt-1 min-h-5" style={{ fontFamily: 'Inter' }}>
              50%
            </div>
          </div>

          {/* Floating Progress Circle - using exact SVG from Motiff */}
          <div 
            className="absolute w-11 h-11 -top-1 -right-1"
            style={{
              backgroundImage: "url('https://static.motiffcontent.com/private/resource/image/197f7732eb0089b-c21f9540-057c-4f25-90f6-c1d773bb725d.svg')",
              backgroundSize: 'cover'
            }}
          ></div>
        </div>

        {/* New Chat Button */}
        <button className="w-full border border-gray-200 rounded-md py-2 text-center text-gray-600 hover:bg-gray-50 transition-colors">
          + New Chat
        </button>
      </div>
    </div>
  );
};

export default WorkspaceHeader;
